import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(
    PTS: number,
    AST: number,
    DREB: number,
    STL: number,
    BLK: number,
    FG_PERC: number,
    FG2_PERC: number,
    FG3A: number,
    FG3_Perc: number,
    FTA: number,
    FTM: number,
    FT_PERC: number,
    PLUS_MINUS: number,
    WIN_LOSS: string
) {
  return { PTS, AST, DREB, STL, BLK, FG_PERC, FG2_PERC, FG3A, FG3_Perc, FTA, FTM, FT_PERC, PLUS_MINUS, WIN_LOSS};
}

const rows = [
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
  createData(37, 7, 6, 2, 1,.50, .46,12, .60, 5, 5, 1.0, +43, 'W'),
];

export default function CustomizedTables() {
  return (
      <div class="App">
        <TableContainer component={Paper}>
          <Table sx={{ width: 50 , display: 'inline'}} aria-label="customized table">
            <TableHead>
              <TableRow>
                <StyledTableCell>Playoff Stats</StyledTableCell>
                <StyledTableCell align="right">PTS</StyledTableCell>
                <StyledTableCell align="right">AST</StyledTableCell>
                <StyledTableCell align="right">DREB&nbsp;</StyledTableCell>
                <StyledTableCell align="right">STL&nbsp;</StyledTableCell>
                <StyledTableCell align="right">BLK&nbsp;</StyledTableCell>
                <StyledTableCell align="right">FG_PERC</StyledTableCell>
                <StyledTableCell align="right">FG2_PERC</StyledTableCell>
                <StyledTableCell align="right">FG3A&nbsp;</StyledTableCell>
                <StyledTableCell align="right">FG3_Perc&nbsp;</StyledTableCell>
                <StyledTableCell align="right">FTA&nbsp;</StyledTableCell>
                <StyledTableCell align="right">FTM</StyledTableCell>
                <StyledTableCell align="right">FT_PERC</StyledTableCell>
                <StyledTableCell align="right">PLUS_MINUS&nbsp;</StyledTableCell>
                <StyledTableCell align="right">WIN_LOSS&nbsp;</StyledTableCell>

              </TableRow>
            </TableHead>
            <TableBody>
              {rows.map((row) => (
                  <StyledTableRow key={row.name}>
                    <StyledTableCell component="th" scope="row">
                      {row.name}
                    </StyledTableCell>
                    <StyledTableCell align="right">{row.PTS}</StyledTableCell>
                    <StyledTableCell align="right">{row.AST}</StyledTableCell>
                    <StyledTableCell align="right">{row.DREB}</StyledTableCell>
                    <StyledTableCell align="right">{row.STL}</StyledTableCell>
                    <StyledTableCell align="right">{row.BLK}</StyledTableCell>
                    <StyledTableCell align="right">{row.FG_PERC}</StyledTableCell>
                    <StyledTableCell align="right">{row.FG2_PERC}</StyledTableCell>
                    <StyledTableCell align="right">{row.FG3A}</StyledTableCell>
                    <StyledTableCell align="right">{row.FG3_Perc}</StyledTableCell>
                    <StyledTableCell align="right">{row.FTA}</StyledTableCell>
                    <StyledTableCell align="right">{row.FTM}</StyledTableCell>
                    <StyledTableCell align="right">{row.FT_PERC}</StyledTableCell>
                    <StyledTableCell align="right">{row.PLUS_MINUS}</StyledTableCell>
                    <StyledTableCell align="right">{row.WIN_LOSS}</StyledTableCell>
                  </StyledTableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </div>

  );
}
